import { useState,useE } from "react";

export function CardComp() {
    const list = [
      { value: 'Name', lable: 'Mr. Sathish Kumar', Gender: 'Gender', GenderValue: 'Male', Language: 'Language', LanguageType: 'Tamil', Slang: 'Slang', SlangType: 'Madurai', Age: 'Age', AgeValue: '25 to 30 years' },
      { value: 'Name', lable: 'Mr. Kumar', Gender: 'Gender', GenderValue: 'Male', Language: 'Language', LanguageType: 'Tamil', Slang: 'Slang', SlangType: 'Madurai', Age: 'Age', AgeValue: '25 to 30 years' },
    ]

    const [data, setData] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    useEffect(() => {
      fetch('http://voicebank.com:8000/api/method/voicebank.voicebank_api.voice_data?language=tamil&gender=&slang=&age=')
        .then(response => {
          if (!response.ok) {
            throw new Error('Network response was not ok');
          }
          return response.json();
        })
        .then(data => {
          setData(data);
          setLoading(false);
        })
        .catch(error => {
          setError(error);
          setLoading(false);
        });
    }, []);

    if (loading) {
      return <div>Loading...</div>;
    }

    if (error) {
      return <div>Error: {error.message}</div>;
    }
  console.log(data,loading,error)
    return (
      <>

        {
          list.map(option => (
            <>
              <div className="card">
                <div className="mem-no">
                  <div className="mno">M. No. 111</div><img
                    src="https://assets-global.website-files.com/6130fc9db35a715a03742ded/66481c047761e1b2e1d6f7b6_Component%202.png"
                    loading="lazy" alt="" />
                </div>
                <div className="card-body"><img
                  src="https://assets-global.website-files.com/6130fc9db35a715a03742ded/655b993d0de1fe87e04cd3c3_hero-image-v4-brix-templates.jpeg"
                  loading="lazy" sizes="125px"
                  srcset="https://assets-global.website-files.com/6130fc9db35a715a03742ded/655b993d0de1fe87e04cd3c3_hero-image-v4-brix-templates-p-500.jpeg 500w, https://assets-global.website-files.com/6130fc9db35a715a03742ded/655b993d0de1fe87e04cd3c3_hero-image-v4-brix-templates-p-800.jpeg 800w, https://assets-global.website-files.com/6130fc9db35a715a03742ded/655b993d0de1fe87e04cd3c3_hero-image-v4-brix-templates-p-1080.jpeg 1080w, https://assets-global.website-files.com/6130fc9db35a715a03742ded/655b993d0de1fe87e04cd3c3_hero-image-v4-brix-templates.jpeg 1192w"
                  alt="Hero - Elements Webflow Library - BRIX Templates" className="image-5" />
                  <div className="cb-text">
                    <div className="text-block-4"><span className="text-span">{option.value}</span>{option.lable}</div>
                    <div className="text-block-4"><span className="text-span">{option.Gender}</span>{option.GenderValue}</div>
                    <div className="text-block-4"><span className="text-span">{option.Language}</span>{option.LanguageType}</div>
                    <div className="text-block-4"><span className="text-span">{option.Slang}</span>{option.SlangType}</div>
                    <div className="text-block-4"><span className="text-span">{option.Age}</span>{option.AgeValue}</div>
                  </div>
                </div>
                <div className="audio-card"></div>
              </div>
            </>
          ))
        }

      </>
    )
  }
